import Slider from "react-slick";



export const Home = () => {
    const images = [
        "",
        "https://example.com/image2.jpg",
        "https://example.com/image3.jpg",
        // Add more images as needed
    ];

        const settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1
        };

        return (
            <Slider {...settings}>
                {images.map((image) => (
                    <div key={image}>
                        <img src={image} alt="slider-img" />
                    </div>
                ))}
            </Slider>
        );
    }
